UITextConst.UI_TEXT_12950	=	1012950--1.成功驗證後，該電子信箱將用於接收《戀與深空》的更新與活動資訊相關信件。填寫信箱並點擊「獲得驗證碼」按鈕後，我們會發送驗證信件給您。2.在您填寫正確的驗證碼並點擊「驗證」按鈕後，我們後續將根據前述目的發送信件至您綁定的信箱，感謝您的支持！3.如您選擇不進行電子信箱驗證，則您可能無法接收到最新的更新或活動資訊，但不會影響您正常使用本遊戲的其它功能。4.如需取消驗證，請聯繫客服。
UITextConst.UI_TEXT_12951	=	1012951--1. 이메일 인증 성공 시, '러브앤딥스페이스'의 업데이트 및 이벤트 정보를 받아보실 수 있습니다. 이메일 주소 입력 및 '인증번호 받기' 버튼을 눌러 인증을 진행하세요.  2.인증번호 입력 후 '인증' 버튼 터치 시, 연동된 이메일로 안내 내용이 발송됩니다.  3.이메일 주소 미인증 시, 최신 업데이트 정보 및 이벤트 정보를 받아보실 수 없습니다. (정상적인 게임 이용에는 영향을 주지 않습니다.)  4.인증 취소는 고객센터에 문의해주세요.
UITextConst.UI_TEXT_12952	=	1012952--1.登録した場合、本メールアドレス宛に「恋と深空」のアップデート情報およびイベント情報などに関するメールマガジンをお送りいたします。メールアドレスを入力し、「認証コード獲得」をタップした後、お客様のメールアドレス宛に認証メールをお送りいたします。2.正しい認証コードを入力し、「認証」をタップすると認証が完了し、メールマガジンが送られるようになります。3.メールアドレスを登録しない場合、メールマガジンは発送されません。本ゲームの各種機能の利用には影響はありません。4.メールアドレスの連携、メールマガジンの受信を取り消したい場合は、カスタマーセンターまでご連絡ください。
UITextConst.UI_TEXT_12953	=	1012953--1. Once the email is successfully verified, you will receive the latest updates and news for "Love and Deepspace". To proceed, please enter your email address and tap the "Get Verification Code" button; we will then send you a verification email.2. After you enter the correct verification code and tap the "Verify" button, we will keep you informed of the game's latest updates and news through your verified email.3. If you don't verify your email, you may not be able to receive any news, but it will not affect your normal use of the game's other features.4. If you wish to cancel the verification, please contact customer service.
