UITextConst.UI_TEXT_15545	=	1015545--【功能版】从入门到精通（1）
UITextConst.UI_TEXT_15546	=	1015546--初始化阶段
UITextConst.UI_TEXT_15547	=	1015547--①开局先手方获得<color=#c06a26>2张</color>数字手牌+<color=#c06a26>1张</color>功能牌。后手方获得<color=#c06a26>3张</color>数字手牌+<color=#c06a26>2张</color>功能牌。②每次轮到己方回合开始时会<color=#c06a26>额外</color>获得系统发放的1张功能牌（对手方同理）
UITextConst.UI_TEXT_15548	=	1015548--回合阶段流程
UITextConst.UI_TEXT_15549	=	1015549--①功能版玩法区分了出牌阶段，分为<color=#c06a26>功能牌决策阶段</color>与<color=#c06a26>数字牌决策阶段</color>。②双方轮流出牌，每人每回合需要<color=#c06a26>先</color>进行功能牌决策，<color=#c06a26>再</color>进入到数字牌决策。
UITextConst.UI_TEXT_15550	=	1015550--胜负判定
UITextConst.UI_TEXT_15551	=	1015551--当8个杯子都装满猫时本局游戏结束，此时获得<color=#c06a26>分数更多</color>的一方<color=#c06a26>获胜</color>。
UITextConst.UI_TEXT_15552	=	1015552--【功能版】从入门到精通（2）
UITextConst.UI_TEXT_15553	=	1015553--功能牌阶段说明
UITextConst.UI_TEXT_15554	=	1015554--①回合开始后必须先对功能牌进行决策。②单轮功能牌出牌数无限制，可按下<color=#c06a26>结束</color>进入下一阶段。③若功能牌用完或使用至无法主动打出，功能牌阶段也会自动结束。
UITextConst.UI_TEXT_15555	=	1015555--数字牌阶段说明
UITextConst.UI_TEXT_15556	=	1015556--①功能牌决策阶段结束后会自动进入数字牌决策环节。②在数字牌决策阶段，可在<color=#c06a26>出牌</color>或者<color=#c06a26>摸牌</color>中选择一项进行。完成后自动结束本阶段。
