UITextConst.UI_TEXT_15604	=	1015604--功能牌爆牌机制
UITextConst.UI_TEXT_15605	=	1015605--爆牌：是指牌库中的卡牌在发放时被直接移除，而不进入手牌的过程，被移除的牌也不会进入弃牌堆中。
UITextConst.UI_TEXT_15606	=	1015606--在喵喵牌功能版中有两种方式会导致爆牌：第一种是手牌已达上限（10张）而继续抽牌。第二种是由于每次轮到己方回合时，系统会额外发放一张功能牌（牌库充裕的情况下），此时手牌已满，会导致系统发放的这张牌直接被移除。
UITextConst.UI_TEXT_15607	=	1015607--额外说明
UITextConst.UI_TEXT_15608	=	1015608--注意：<color=#c06a26>否决喵</color>是一种<color=#c06a26>特殊</color>的功能牌，不受回合限制。可以在任意时刻打出否决喵否决对方的功能牌使用，但基础出数字牌和摸牌行为无法被否决。功能牌决策阶段结束后自动进入数字牌决策环节。
