UITextConst.UI_TEXT_37021	=	1037021--尊敬的用户，您好！在您开始下一步有关“恋与深空”的游戏账户注销流程前，我们先为您做出如下特别说明：注销账户为不可恢复的操作，账户注销后您将无法再以本账户登录和使用“恋与深空”游戏产品或服务，请您谨慎操作。为免疑义，您根据本协议进行的游戏账户注销仅针对您“恋与深空”对应区服的游戏账户，您对前述游戏账户的注销不会影响您持有的叠纸账号的其他功能/服务、其他叠纸游戏以及“恋与深空”其他区服的登录/使用/继续使用。特别地，如您是通过登录经叠纸认可的第三方平台账号使用我们提供的游戏产品或服务的，我们可能无法为您提供该第三方平台账号在“恋与深空”游戏的游戏账户注销服务。请您联系您所使用的第三方平台账号对应的第三方渠道/平台，按照该第三方渠道/平台提供的指引进行操作。您成功注销“恋与深空”游戏的游戏账户后，我们将按照《“恋与深空”用户个人信息和隐私保护政策》的相关约定对您的个人信息进行删除或匿名化处理（但法律法规另有规定的除外，例如，您游戏账户的日志信息将被保留不少于6个月的时间），且此前已关联该“恋与深空”游戏账户的相关产品与服务将不再关联。若您经过慎重考虑后仍决定注销“恋与深空”游戏账户的，请您务必先行仔细阅读和充分理解本《“恋与深空”游戏账户注销协议》（“本协议”），并同意本协议全部内容，尤其是本协议免责、限制条款（如第一条第3款）及争议解决方式和管辖条款（第四条），前述条款可能以黑体加粗、颜色标记或其他合理方式提示您注意，本协议由您与“恋与深空”游戏服务提供方（以下称“我们”）共同缔结，本协议具有合同效力。您按照我们的注销操作流程开始注销流程的，或者您通过主动点击或勾选的方式同意本注销协议并开始下一步操作的，均视为您已经同意遵守本协议全部内容。<color=#c06a26>为确保注销的顺利完成，请您在约定的账户注销申请处理期间内不要使用该账户登录本游戏，否则视为您撤销注销该账户。</color>一、游戏账户注销后您承担的后果您充分理解并同意：您自愿承担您的“恋与深空”游戏账户注销所（可能）产生的所有后果，前述后果包括但不限于：1.您将无法登录/使用/继续使用与该“恋与深空”游戏账户相关的所有产品或服务，且该账户无法恢复，即使您在账户注销后以相同的叠纸账号或第三方平台账号再次登录“恋与深空”游戏中的对应区服，该账号于该区服中将被默认为全新的游戏用户，相应区服中所生成的所有内容、信息、数据、记录都不再与您之前“恋与深空”游戏账户信息关联，您之前“恋与深空”游戏账户中的好友亦无法与您在本游戏内进行互动。因此，我们善意地提醒您在申请注销前对需要备份的内容提前做好备份。2.游戏账户注销后，您曾通过该账户登录、使用“恋与深空”产品及服务下的所有内容、信息、数据、记录将会被删除或匿名化处理（但法律法规另有规定除外），前述内容、信息、数据、记录被删除或匿名化处理后您将无法再检索、访问、传输、获取、继续使用、复制和找回，也无权要求我们找回。该等内容、信息、数据或记录包括但不限于：（1）该账户下您的个人信息，包括手机号码、实名信息、密码密保和其他个人信息；（2）该账户下您曾使用过的所有“恋与深空”产品及服务，包括但不限于头像、昵称、游戏角色、与游戏角色成长升级相关的所有数据（包括但不限于经验值、称号等）、虚拟道具、邮件、充值和消费记录、聊天记录、排名等；（3）该账户下的其他所有内容、信息、数据、记录。3.游戏账户注销后，我们将会对该账户下的全部权益（如有）做清除处理。据此，我们特别提示您，在您注销本游戏账户前请您妥善处理、结清您在“恋与深空”游戏内的相关资产和收益。您理解并同意：通过注销游戏账户的方式放弃该账户在“恋与深空”游戏相关的产品及服务使用期间已产生但尚未消耗完毕的权益及未来可能产生的预期利益；您同意：不会要求我们恢复或赔偿该等权益或预期利益。该等权益或预期利益包括但不限于：（1）该账户下尚未使用的网络游戏虚拟货币、虚拟道具等虚拟物品（如金币、钻石、道具及其他等）、资产、充值积分、等级等；（2）该账户下您的各类资格、会员权益（包括但不限于游戏月卡等）、连续包月权利等；（3）该账户下您已产生但未消耗完毕的其他游戏收益或未来预期的游戏收益权益；（4）该账户下您的各类身份权益；（5）该账户下您已经购买但未到期的服务内容；（6）“恋与深空”游戏账户一旦注销，您与我们签署的有关“恋与深空”游戏的《叠纸游戏许可及服务协议》、其他权利义务性文件即告终止（但已约定继续生效的除外）。但上述协议的终止并不能够减轻或免除您在协议期间内应根据相关法律法规、相关协议、规则等（可能）需要承担的责任包括但不限于可能产生的违约责任、损害赔偿责任及履约义务等。4.如您的账户曾因违反国家相关法律法规和/或您与我们签署的有关使用“恋与深空”游戏服务的相关协议、规则（以下称“用户协议”）等相关规定，而被我们采取封号及（或）其他处理措施的，为了维护您和其他相关权利人的合法权益所必须，在您游戏账户注销后我们可能会对与该账户违规行为有关的游戏数据保留3年。在保留期限内，我们除将该数据用于维护您和其他相关权利人的合法权益外，不会用于其他目的。5.其他因账户注销（可能）产生的后果。二、注销游戏账户所应具备的条件在您向我们申请/继续申请注销游戏账户之前，为保障您的账户安全和相关权益，您需先行检查，并确保和承诺您申请注销的游戏账户已经同时满足以下条件，这些条件包括但不限于：1.该游戏账户为您本人合法拥有并登录使用，且符合用户协议及相关说明规则中有关游戏账户的规范。 2.该账户在申请注销前及申请注销期间没有未处理完毕的纠纷，包括但不限于投诉举报、被投诉举报、国家机关调查、仲裁、诉讼等。3.该账户在申请注销前及申请注销期间未处于被检查、被限制的状态。4.该账户在最近两周内无异常登录记录，无账户敏感操作，该游戏账户处于安全及正常使用状态，无其他安全风险。5.该账户内相关游戏资产和收益已结清或得到妥善处理，特别地，负资产需要结清。请您妥善处理您的游戏收益，若注销时未处理，视为您自愿放弃该等游戏收益。6.该账户内无任何未完成的订单或交易，包括但不限于基于该游戏账户产生的有关网络游戏虚拟货币、虚拟道具、周边商品等的订单等。7.该账户内没有已经发起但未完成的抽奖活动。8.该账户已解除特殊身份关系（如公会会长/管理员等，具体以游戏内实际情况为准）。9.如您曾基于该账户开通了“自动订阅”/“自动续费”/“连续包月”等包含自动扣费或同类型功能的服务，您应当确保事先取消该等功能和服务。10.不存在任何由于该等注销而导致的未了结的合同关系和/或其他基于该账户的存在而产生的或维持的权利义务，以及我们认为注销该账户会由此产生未了结的权利义务而产生纠纷的情况。11.本游戏官方公布的其他条件。上述问题您可首先尝试自行处理，如您无法处理的或在处理过程中有任何疑惑的，可联系我们的客服协助处理。三、如何注销游戏账户？1.您需按照我们的官方渠道提供的注销流程和操作指引，在相关功能设置页面进行注销操作。2.您已经同意本注销协议的全部内容，同时，您已经检查与确认满足了本协议第二条的要求。3.在您完成本条第2款后，为进一步保障您的相关合法权益，我们有权视情况验证您是否满足本协议第二条规定的部分或全部注销条件。如我们验证的，我们有权根据您的账户安全状态以及您对相关产品与服务的使用情况等综合判断您的账户是否符合该注销条件。为保障您的账户安全和财产权益，我们有权进行注销申请的身份验证以判断您是该游戏账户的有权使用人。如我们在综合判断后发现该游戏账户不符合注销条件的，或者身份验证失败的，您的注销可能会失败，您可以按照我们的指引进行后续操作或联系我们的客服协助处理。4.我们需要特别说明的是：即使我们判断您符合账户注销条件，也是基于您的承诺（即您自身确保游戏账户符合上述注销条件的承诺）进行的形式审查，仍由您自身对游戏账户符合上述注销条件承担保证责任，我们对此不承担相应的法律责任。5.我们将在15个自然日内响应您的注销申请。具体注销流程和规则以游戏内官方说明的账户注销规则为准。6.请您特别注意若您在约定的账户注销申请处理期间，使用该账户登录或使用本游戏，则视为您撤销该账户注销申请；如您通过上述方法撤销账户申请后拟重新申请账户注销的，您可以立即再次申请进行账户注销。同时。您理解并同意，在对该账户下的个人信息删除或匿名化之前，为最大程度保障您和其他用户合法权益，我们需要一定时间对该账户下的个人信息作相应梳理和处理，因此，我们删除或匿名化处理该账户下的个人信息可能会存在一定的延迟。7.您理解并同意，在您申请注销账户期间，如我们需要对相关交易、投诉或其他与您的账户相关的事项进行核实的，或者我们有其他合理的理由（包括但不限于投诉、举报、诉讼、仲裁、国家有权机关调查等）的，我们有权冻结您的账户注销申请并暂停为您提供注销服务而无需另行得到您的同意。四、其他1.本协议为用户协议（“主协议”）组成部分，本协议未尽事宜适用主协议。本协议与主协议不一致的，以本协议为准。2.本协议签订地为上海市杨浦区。3.本协议的成立、生效、履行、解释及纠纷解决，适用中华人民共和国大陆地区法律法规（不包括冲突规范）。4.若您和我们之间因本协议发生任何纠纷或争议，首先应友好协商解决；协商不成的，本协议双方均应向本协议签订地有管辖权的法院提起相关诉讼。5.联系我们：如在账户注销过程中有任何问题您无法处理的或在处理过程中有任何疑惑的，可联系我们的客服协助处理。
